"use strict";(self.webpackChunkdocs=self.webpackChunkdocs||[]).push([[567],{5226:e=>{e.exports=JSON.parse('{"version":{"pluginId":"default","version":"current","label":"Next","banner":null,"badge":false,"noIndex":false,"className":"docs-version-current","isLast":true,"docsSidebars":{"tutorialSidebar":[{"type":"link","label":"intro","href":"/","docId":"intro","unlisted":false},{"type":"category","label":"Architecture","collapsible":true,"collapsed":true,"items":[{"type":"link","label":"Account Circuit","href":"/architecture/account-circuit","docId":"architecture/account-circuit","unlisted":false},{"type":"link","label":"Intro to architecture","href":"/architecture/intro","docId":"architecture/intro","unlisted":false},{"type":"category","label":"Contracts","collapsible":true,"collapsed":true,"items":[{"type":"link","label":"L1-Session Contract","href":"/architecture/contracts/l1-session-contracts copy","docId":"architecture/contracts/l1-session-contracts copy","unlisted":false},{"type":"link","label":"L2-Session Contract","href":"/architecture/contracts/l2-session-contracts","docId":"architecture/contracts/l2-session-contracts","unlisted":false}],"href":"/category/contracts"}],"href":"/category/architecture"},{"type":"category","label":"Use Cases","collapsible":true,"collapsed":true,"items":[{"type":"link","label":"Automatizing Verifiable AI agents","href":"/use-cases/automatizing-verifiable-ai-agents","docId":"use-cases/automatizing-verifiable-ai-agents","unlisted":false},{"type":"link","label":"Cross-chain Intents","href":"/use-cases/cross-chain-intents","docId":"use-cases/cross-chain-intents","unlisted":false},{"type":"link","label":"DeFi: Cross Chain Liquidity Pools","href":"/use-cases/defi-cross-chain-liquidity-pools copy","docId":"use-cases/defi-cross-chain-liquidity-pools copy","unlisted":false},{"type":"link","label":"On-chain Subscriptions","href":"/use-cases/on-chain-subscriptions","docId":"use-cases/on-chain-subscriptions","unlisted":false}],"href":"/category/use-cases"},{"type":"category","label":"Concepts","collapsible":true,"collapsed":true,"items":[{"type":"category","label":"Ai Agents","collapsible":true,"collapsed":true,"items":[{"type":"link","label":"What are AI agents?","href":"/concepts/Ai Agents/what-are-ai-agents","docId":"concepts/Ai Agents/what-are-ai-agents","unlisted":false},{"type":"link","label":"Automatizing AI agents","href":"/concepts/Ai Agents/automatizing-ai-agents","docId":"concepts/Ai Agents/automatizing-ai-agents","unlisted":false},{"type":"link","label":"Verifiable Computing","href":"/concepts/Ai Agents/verifiable-computing","docId":"concepts/Ai Agents/verifiable-computing","unlisted":false}],"href":"/category/ai-agents"},{"type":"category","label":"Session Keys","collapsible":true,"collapsed":true,"items":[{"type":"link","label":"What are session keys?","href":"/concepts/Session Keys/what-are-session-keys","docId":"concepts/Session Keys/what-are-session-keys","unlisted":false},{"type":"link","label":"Threat Model","href":"/concepts/Session Keys/threat-model","docId":"concepts/Session Keys/threat-model","unlisted":false}],"href":"/category/session-keys"},{"type":"category","label":"Keystore Network","collapsible":true,"collapsed":true,"items":[{"type":"link","label":"What and why a keystore network?","href":"/concepts/Keystore Network/what-and-why-a-keystore-network","docId":"concepts/Keystore Network/what-and-why-a-keystore-network","unlisted":false},{"type":"link","label":"Minimal key-value store blockchain","href":"/concepts/Keystore Network/minimal-key-value-store-blockchain copy","docId":"concepts/Keystore Network/minimal-key-value-store-blockchain copy","unlisted":false},{"type":"link","label":"Session Store Network","href":"/concepts/Keystore Network/sessionstore-network","docId":"concepts/Keystore Network/sessionstore-network","unlisted":false}],"href":"/category/keystore-network"},{"type":"link","label":"Key Management Abstraction","href":"/concepts/glossary-of-terms","docId":"concepts/glossary-of-terms","unlisted":false}],"href":"/category/concepts"}]},"docs":{"architecture/account-circuit":{"id":"architecture/account-circuit","title":"Account Circuit","description":"Currently, implementing validation for Keystore updates requires writing zk circuits. However, the number of people who understand and can write zk circuits is small. This barrier to developers risks reduced adoption of the Keystore Rollup.","sidebar":"tutorialSidebar"},"architecture/contracts/l1-session-contracts copy":{"id":"architecture/contracts/l1-session-contracts copy","title":"L1-Session Contract","description":"","sidebar":"tutorialSidebar"},"architecture/contracts/l2-session-contracts":{"id":"architecture/contracts/l2-session-contracts","title":"L2-Session Contract","description":"","sidebar":"tutorialSidebar"},"architecture/intro":{"id":"architecture/intro","title":"Intro to architecture","description":"Key Management Abstraction (KMA) removes the complexities for users to manage (store, backup/retrieve, rotate, import/export, etc.) private keys in a secure way. The kind of complexities and what security exactly means is discussed as follows:","sidebar":"tutorialSidebar"},"concepts/Ai Agents/automatizing-ai-agents":{"id":"concepts/Ai Agents/automatizing-ai-agents","title":"Automatizing AI agents","description":"AI agents hold the potential to revolutionize blockchain systems by enabling full automation of smart contract interactions. These agents can execute tasks autonomously, leveraging on-chain data and programmable permissions. In an environment where speed and verifiability are paramount, AI agents can automate complex decision-making processes, driving transactions and state changes at unprecedented speeds.","sidebar":"tutorialSidebar"},"concepts/Ai Agents/verifiable-computing":{"id":"concepts/Ai Agents/verifiable-computing","title":"Verifiable Computing","description":"Verifiable computing is a critical component in trustless blockchain ecosystems. When AI agents interact with smart contracts, it is vital that the outcomes of their computations are verifiable by all participants. By leveraging zero-knowledge proofs (ZKPs), AI agents can provide cryptographic evidence of their computations, ensuring that results are accurate without needing full data disclosure.","sidebar":"tutorialSidebar"},"concepts/Ai Agents/what-are-ai-agents":{"id":"concepts/Ai Agents/what-are-ai-agents","title":"What are AI agents?","description":"AI agents are autonomous programs designed to operate within blockchain environments. These agents can perform complex tasks\u2014such as executing smart contract logic, verifying data, and interacting with oracles\u2014without human intervention. AI agents unlock unprecedented capabilities in the blockchain space, allowing for fully automated, decentralized applications (dApps) to run smoothly and efficiently.","sidebar":"tutorialSidebar"},"concepts/glossary-of-terms":{"id":"concepts/glossary-of-terms","title":"Key Management Abstraction","description":"Key Management Abstraction (KMA) removes the complexities for users to manage (store, backup/retrieve, rotate, import/export, etc.) private keys in a secure way. The kind of complexities and what security exactly means is discussed as follows:","sidebar":"tutorialSidebar"},"concepts/Keystore Network/minimal-key-value-store-blockchain copy":{"id":"concepts/Keystore Network/minimal-key-value-store-blockchain copy","title":"Minimal key-value store blockchain","description":"A minimal key-value store blockchain represents the simplest form of a blockchain that supports basic storage and retrieval of data. By utilizing a minimalist architecture, these blockchains focus on achieving high performance and scalability with reduced complexity. Each key represents a unique identifier for data, while the corresponding value is the data stored at that location.","sidebar":"tutorialSidebar"},"concepts/Keystore Network/sessionstore-network":{"id":"concepts/Keystore Network/sessionstore-network","title":"Session Store Network","description":"The Sessionstore network is designed to securely manage and store temporary cryptographic keys that are essential for securing communication in decentralized environments. Unlike permanent keystore networks, which manage long-term keys, Sessionstore focuses on managing short-lived keys\u2014often referred to as session keys.","sidebar":"tutorialSidebar"},"concepts/Keystore Network/what-and-why-a-keystore-network":{"id":"concepts/Keystore Network/what-and-why-a-keystore-network","title":"What and why a keystore network?","description":"A keystore network is a decentralized system designed to securely store, manage, and retrieve cryptographic keys. Cryptographic keys are essential for performing secure transactions and interacting with smart contracts. In decentralized systems, ensuring the security and availability of these keys is paramount.","sidebar":"tutorialSidebar"},"concepts/Session Keys/threat-model":{"id":"concepts/Session Keys/threat-model","title":"Threat Model","description":"Session keys are a foundational component of many cryptographic protocols, providing temporary security for communication channels. However, they are subject to various threats, including:","sidebar":"tutorialSidebar"},"concepts/Session Keys/what-are-session-keys":{"id":"concepts/Session Keys/what-are-session-keys","title":"What are session keys?","description":"Session keys are temporary cryptographic keys generated for the purpose of securing a communication session. Unlike long-term keys stored in keystore networks, session keys are only valid for the duration of a particular session, after which they are discarded.","sidebar":"tutorialSidebar"},"intro":{"id":"intro","title":"intro","description":"Functor Network by Security Labs is a unified access layer for the autonomous world. Two of the fastest-growing technological fronts today, artificial intelligence (AI) and cryptography, are two faces of the same future: A future where most human activity can be enhanced securely and expressively through technology.","sidebar":"tutorialSidebar"},"use-cases/automatizing-verifiable-ai-agents":{"id":"use-cases/automatizing-verifiable-ai-agents","title":"Automatizing Verifiable AI agents","description":"Verifiable AI agents enable a new paradigm of trustless automation in decentralized systems. These agents can autonomously execute tasks\u2014such as transactions, data verifications, and cross-chain interactions\u2014while proving the correctness of their computations through cryptographic methods like zero-knowledge proofs (ZKPs).","sidebar":"tutorialSidebar"},"use-cases/cross-chain-intents":{"id":"use-cases/cross-chain-intents","title":"Cross-chain Intents","description":"Cross-chain intents refer to predefined actions or triggers that facilitate seamless interaction between multiple blockchain networks. As the blockchain ecosystem grows, interoperability between different chains becomes increasingly important, allowing assets, data, and transactions to move across platforms securely and efficiently.","sidebar":"tutorialSidebar"},"use-cases/defi-cross-chain-liquidity-pools copy":{"id":"use-cases/defi-cross-chain-liquidity-pools copy","title":"DeFi: Cross Chain Liquidity Pools","description":"Cross-chain liquidity pools in decentralized finance (DeFi) enable liquidity providers to pool assets across multiple blockchain networks, ensuring that liquidity can flow seamlessly between different chains. By doing so, DeFi applications can offer users better trading opportunities, lower slippage, and more efficient capital utilization.","sidebar":"tutorialSidebar"},"use-cases/on-chain-subscriptions":{"id":"use-cases/on-chain-subscriptions","title":"On-chain Subscriptions","description":"On-chain subscriptions allow users to subscribe to services, content, or utilities in a decentralized manner, with payments and access rights managed entirely by smart contracts. By leveraging the transparency and automation of blockchain technology, on-chain subscriptions remove the need for intermediaries and allow users to engage directly with service providers.","sidebar":"tutorialSidebar"}}}}')}}]);